import React from 'react';
import { Container } from 'react-bootstrap';
import VendorInfoCard from './VendorInfoCard';
import VendorLogoCard from './VendorLogoCard';
import DispensaryInfoCard from './DispensaryInfoCard';
import DeactivateAccount from './DeactivateAccount';

const AccountPage = () => {
  return (
    <Container className="py-4 d-flex flex-column align-items-stretch">
      {/* Page Title */}
      <h2 className="text-center mb-4">Account</h2>

      {/* Flexbox Layout */}
      <div className="d-flex flex-wrap justify-content-between mb-4">
        {/* VendorLogoCard */}
        <div className="flex-grow-1 flex-md-basis-50 px-2 mb-3">
          <VendorLogoCard />
        </div>

        {/* VendorInfoCard */}
        <div className="flex-grow-1 flex-md-basis-50 px-2 mb-3">
          <VendorInfoCard />
        </div>
      </div>

      {/* DispensaryInfoCard */}
      <div className="w-100 mb-4">
        <DispensaryInfoCard />
      </div>

      {/* DeactivateAccount */}
      <div className="mt-auto d-flex justify-content-end">
        <DeactivateAccount />
      </div>
    </Container>
  );
};

export default AccountPage;
